parameters_var <- function(var=list(),n1,dist,eff){
  
  param<-matrix(0,16,12)
  row_name=expand.grid(SSR="SSR=",SDR="SDR=",SDR_values=c(0.5,1,2,4),SSR_values=c(0.5,1,1.5,2))
  rownames(param) <- paste(row_name$SSR,row_name$SSR_values,row_name$SDR,row_name$SDR_values)
  col_name=expand.grid(sample="var_sample",number=c(1:3),parameter=c("mean_","sd_","kurtosis_","skewness_"))
  colnames(param) <- paste0(col_name$parameter,col_name$sample,col_name$number)
  
  for (s in 1:16){
    param[s,1] = round(mean(var[[s]][,7]^2),2)
    param[s,2] = round(mean(var[[s]][,8]^2),2)
    param[s,3] = round(mean(var[[s]][,9]^2),2)
    
    param[s,4] = round(sd(var[[s]][,7]^2),2)
    param[s,5] = round(sd(var[[s]][,8]^2),2)
    param[s,6] = round(sd(var[[s]][,9]^2),2)
    
    param[s,7] = round(kurtosis(var[[s]][,7]^2),2)
    param[s,8] = round(kurtosis(var[[s]][,8]^2),2)
    param[s,9] = round(kurtosis(var[[s]][,9]^2),2)
    
    param[s,10] = round(skewness(var[[s]][,7]^2),2)
    param[s,11] = round(skewness(var[[s]][,8]^2),2)
    param[s,12] = round(skewness(var[[s]][,9]^2),2)
  }
  
  distName <- "dist=["
  
  for (j in 1:3){
    
    if (j == 3){
      distName <- paste(distName,dist[j],"]")
      
    } else {
      distName <- paste(distName,dist[j],",")
      
    }
    
  }
  
  setwd(dir="C:/Users/mdela/Desktop/ANOVA vs welch/Plots/descriptives/With effect/DE of var") # destination file  
  write.table(param,paste0(eff,"n1=",n1,", ",distName,".txt"),sep=";",dec=",")
  
  
  
}

